// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
pragma abicoder v2;  // Enable ABI coder v2

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract BlockStorage is Ownable, Pausable {
    struct HashRecord {
        uint8 c;
        uint32 m;
        uint8 t;
        uint8 v;
        bytes32 k;
        bytes s;
    }

    uint256 public constant BASE_REWARD = 10 ether;
    uint256 public constant BASE_REWARD_INTERVAL_S = 365 * 24 * 60 * 60;
    uint256 public constant TARGET_BLOCK_TIME_S = 1;
    uint256 public constant DEFAULT_DIFFICULTY = 100_000;
    uint256 public constant GENESIS_TS = 1694158682; // 2023-09-08T07:38:01.656Z
    string public constant GENESIS_TWEET = 'https://twitter.com/mrJackLevin/status/1700050845562515517';
    string public constant AUTHORS = '@mrJackLevin';

    // params settable by the authority
    uint256 public variance = 20;
    uint256 public difficultyAdjustment = 2_000;

    uint256 public currentReward = BASE_REWARD;     // halves every 365 days
    uint256 public currentRewardTs = GENESIS_TS;    // is set every 365 days
    uint256 public difficulty;                      // is adjusted with every new batch

    constructor(uint256 _difficulty) {
        difficulty = _difficulty > 0 ? _difficulty : DEFAULT_DIFFICULTY;
    }

    event HashLog(uint256 indexed recordType, uint256 tsStart, uint256 tsEnd, uint256 count, bytes32 hash);
    event NewHashLog(uint256 indexed recordType, uint256 tsStart, uint256 tsEnd, uint256 count, bytes32 hash);
    event NewDifficulty(uint256 indexed difficulty, uint256 tsStart, uint256 tsEnd);

    event BaseRewardSet(uint256 reward, uint256 ts);

    event VarianceSet(uint256 indexed variance, uint256 ts);
    event DifficultySet(uint256 indexed difficulty, uint256 ts);
    event DifficultyAdjustmentSet(uint256 indexed adjustment, uint256 ts);

    function setVariance(uint256 _variance) external onlyOwner {
        require(_variance > 0 && _variance < 100, 'X1: Illegal Variance');
        variance = _variance;
        emit VarianceSet(_variance, block.timestamp);
    }

    function setDifficulty(uint256 _difficulty) external onlyOwner {
        require(_difficulty > 0, 'X1: Illegal Difficulty');
        difficulty = _difficulty;
        emit DifficultySet(_difficulty, block.timestamp);
    }

    function setDifficultyAdjustment(uint256 _difficultyAdjustment) external onlyOwner {
        require(_difficultyAdjustment > 0 && _difficultyAdjustment < difficulty, 'X1: Illegal Difficulty Adjustment');
        difficultyAdjustment = _difficultyAdjustment;
        emit DifficultyAdjustmentSet(_difficultyAdjustment, block.timestamp);
    }

    function lockDifficulty() external onlyOwner {
        _pause();
    }

    function unlockDifficulty() external onlyOwner {
        _unpause();
    }

    /*
        @dev Internal utility for adjusting difficulty
    */
    function _calcAndAdjustDifficulty(uint256 tsStart, uint256 tsEnd, uint256 count) internal {
        if (paused()) return;

        uint256 newDifficulty = difficulty * (tsEnd - tsStart) / (count * TARGET_BLOCK_TIME_S);
        if (newDifficulty < difficulty - difficultyAdjustment) {
            difficulty -= difficultyAdjustment;
        } else if (newDifficulty < difficulty) {
            difficulty = newDifficulty;
        } else if (newDifficulty > difficulty + difficultyAdjustment) {
            difficulty += difficultyAdjustment;
        } else if (newDifficulty > difficulty) {
            difficulty = newDifficulty;
        }
        emit NewDifficulty(difficulty, tsStart, tsEnd);
    }

    /*
        @dev Public utility for good housekeeping
    */
    function doHousekeeping() public {
        if (block.timestamp - currentRewardTs > BASE_REWARD_INTERVAL_S) {
            currentRewardTs = block.timestamp;
            currentReward /= 2;
            emit BaseRewardSet(currentReward, currentRewardTs);
        }
    }

    /*
        @dev Submit back-stored records data
    */
    function logStoreRecords(
        uint256 recordType,
        uint256 tsStart,
        uint256 tsEnd,
        uint256 count,
        bytes calldata blob
    ) external {
        require(count > 0, 'X1: Record count cannot be zero');
        require(blob.length > 0, 'X1: Record bytes empty');
        require(tsEnd > tsStart && tsStart > 0, 'X1: Illegal Timestamps');

        doHousekeeping();
        emit HashLog(recordType, tsStart, tsEnd, count, keccak256(blob));
    }

    function logStoreNewRecords(
        uint256 recordType,
        uint256 tsStart,
        uint256 tsEnd,
        uint256 count,
        bytes calldata blob
    ) external {
        require(count > 0, 'X1: Record count cannot be zero');
        require(blob.length > 0, 'X1: Record bytes empty');
        require(tsEnd > tsStart && tsStart > 0, 'X1: Illegal Timestamps');

        if (recordType == 0) {
            // only for hashes, not xunis
            _calcAndAdjustDifficulty(tsStart, tsEnd, count);
        }
        doHousekeeping();
        emit NewHashLog(recordType, tsStart, tsEnd, count, keccak256(blob));
    }

    /*
        Public interface
        @dev decode a record stored as bytes into discrete params
    */
    function decodeRecordBytes(bytes memory _data)
        public
        pure
        returns (uint8 c, uint32 m, uint8 t, uint8 v, bytes32 k, bytes memory s)
    {
        uint len;
        assembly {
            len := mload(_data)
            c := mload(add(_data, 1))
            m := mload(add(_data, 5))
            t := mload(add(_data, 6))
            v := mload(add(_data, 7))
            k := mload(add(_data, 39))
        }
        s = new bytes(len - 39);
        assembly {
            // Skip the first 32 bytes reserved for the length of the memory array
            let offset := add(s, 0x20)
            let count := sub(len, 39)
            for { let i := 0} lt(i, count) { i := add(i, 1) } {
                mstore8(add(offset, i), mload(add(_data, add(40, i))))
            }
        }
    }

}
